import React, { useState } from 'react';
import { v4 as uuid } from 'uuid';
import Movie from './Movie';
const Movies = () => {

  const [movies] = useState([
    {
      id: uuid(),
      name: 'The Shawshank Redemption',
      year: 1994,
      rating: 9.2,
      image: 'https://m.media-amazon.com/images/M/MV5BMTIwNjQ5MjQxNF5BMl5BanBnXkFtZTcwMjQ5NjQ2Mw@@._V1_SX300.jpg',
    },
    {
      id: uuid(),
      name: 'The Godfather',
      year: 1972,
      rating: 9.1,
      image: 'https://m.media-amazon.com/images/M/MV5BMTYwNjQ5MjQxN15BMl5BanBnXkFtZTYwNjQ5NjQ2._V1_SX300.jpg',
    },
    {
      id: uuid(),
      name: 'The Godfather: Part II',
      year: 1974,
      rating: 9.0,
      image: 'https://m.media-amazon.com/images/M/MV5BMTYwNjQ5MjQxN15BMl5BanBnXkFtZTYwNjQ5NjQ2._V1_SX300.jpg',
    }
  ]);
  return (
    <>
      {movies.map((movie) => (
        <Movie key={movie.id} {...movie} />
      ))}
    </>
  );
};

export default Movies;
